import React from 'react';
import {StyledNavBtn, StyledButton, StyledButtonList, StyledNavBtnLink} from './styles';

type Props = {
    caption: string;
}

type ListProps = {
    children: React.ReactNode;
}

export function Button({caption}: Props){
    return(
        <StyledButton>
            {caption} 
        </StyledButton>
    );
};

export function ButtonList({children}: ListProps){
    return(
        <StyledButtonList>
            {children}
        </StyledButtonList>
    );
};

export function NavBtn({children}: ListProps){
    return(
        <StyledNavBtn>
            {children}
        </StyledNavBtn>
    );
};

export function NavBtnLink({children}: ListProps){
    return(
        <StyledNavBtnLink>
            {children}
        </StyledNavBtnLink>
    );
}
